import './portfolio.css'
function Portfolio() {

  return (
    <>
      <section>
        <h1>Portfolio</h1>
        <div>
          <div className='row'>
            {/* <div className='col'> */}
            <div class="col card bg-dark text-light" style={{width: '18rem'}}>
              <div class="card-body text-center">
                <h5 class="card-title">Logo Design</h5>
                <p class="card-text">Some quick example text to build on the card title.</p><hr/>
              </div>
            </div>
            {/* </div> */}
          </div>
        </div>
      </section>
    </>
  );
}

export default Portfolio;
